import React from 'react';

// Storybook

// Components
import { Layout, Header, Footer, Sider, Content } from './Layout';
import { StoryArticle, StoryHeader, StorySection } from '../../../utils/storybook/StyledStoryComponents';
import Docs from './LAYOUT.md';

// Utils
import { createStory } from '../../../utils/storybook/storybookUtils';

createStory('Layout|/').add('Layout', () => {
  return (
    <StoryArticle>
      <StoryHeader>
        <h1>Layout</h1>
      </StoryHeader>

      <StorySection>
        <StoryHeader>
          <h2>Basic Structure</h2>
        </StoryHeader>

        <Layout>
          <Header>Header</Header>
          <Content>Content</Content>
          <Footer>Footer</Footer>
        </Layout>

        <Layout>
          <Header>Header</Header>
          <Layout>
            <Sider>Sider</Sider>
            <Content>Content</Content>
          </Layout>
          <Footer>Footer</Footer>
        </Layout>

        <Layout>
          <Header>Header</Header>
          <Layout>
            <Content>Content</Content>
            <Sider>Sider</Sider>
          </Layout>
          <Footer>Footer</Footer>
        </Layout>

        <Layout>
          <Sider>Sider</Sider>
          <Layout>
            <Header>Header</Header>
            <Content>Content</Content>
            <Footer>Footer</Footer>
          </Layout>
        </Layout>
      </StorySection>
    </StoryArticle>
  );
},
{
  notes: {
    markdown: Docs,
  },
});
